COPY public.minecraft_app_serverrule (id, title, description, "order") FROM stdin;
10	Triche, exploitation de bugs et comptes alternatifs	1.1 Clients permettant de cheat & autres mods\r\nLes clients de triche, les touches macro et les autres modifications qui donnent un avantage de jeu sur les autres joueurs ne sont pas autorisés. Les joueurs enfreignant cette règle seront bannis de manière permanente.\r\n\r\nExceptions autorisées :\r\n\r\nOptiFine et autres mods d'amélioration de performance,\r\n\r\nMods affichant l’armure et les effets (HUD),\r\n\r\nMods de minimap, sauf s’ils montrent plus d’informations que la carte du site web,\r\n\r\nMods purement esthétiques,\r\n\r\nLitematica sans la fonction "printer" (Schematica n’est pas autorisé),\r\n\r\nContactez le staff du serveur si vous n’êtes pas sûr qu’un client ou qu'un mod soit autorisé.\r\n\r\n\r\n1.2 Profiter sciemment ou aider d'autres joueurs à enfreindre les règles\r\nLes joueurs qui assistent intentionnellement, participent consciemment ou profitent d'autres joueurs enfreignant les règles peuvent être sanctionnés comme s’ils avaient commis l’acte eux-mêmes.\r\n\r\n1.3 Erreurs techniques et exploitation de bugs\r\nIl est interdit de profiter de bugs apparents ou d’oublis techniques. Les joueurs qui exploitent de tels problèmes sans en informer le staff peuvent être bannis de manière permanente. Merci d'informer le staff si vous en trouvez un.\r\n\r\n1.4 Comptes alternatifs\r\nLes comptes alternatifs ou "alts" ne sont pas autorisés. Un seul compte est autorisé par joueur. Les comptes alternatifs seront bannis et le compte principal pourra recevoir un avertissement. Une récidive entraînera un bannissement du compte principal.\r\n\r\nCependant, il est permis pour plusieurs personnes physiques de jouer à partir de la même adresse IP sur plusieurs comptes MC.\r\nContactez le staff si vous souhaitez changer de compte principal ou si vous utilisez la même adresse IP qu'un autre joueur. \r\n1.5 Provoquer intentionnellement du lag ou perturber le fonctionnement de Novania\r\n\r\nLes joueurs causant intentionnellement du tort aux services proposés pourront être bannis définitivement.	0
11	Comportement et chat	Les noms des villes & nations doivent :\r\n\r\nNe pas être fictifs; ils doivent correspondre à une nation réelle passée ou actuelle.,\r\n\r\nÊtre basés sur une région, province ou autre zone géographique aux frontières définies.,\r\n\r\nCorrespondre à la localisation sur la carte de la capitale de la nation.,\r\n\r\nLes noms de villes ne doivent pas être inappropriés, toxiques ou offensants.,\r\n\r\nLes noms des villes comme des nations doivent avoir la bonne synthaxe, avec une lettre capitale. Exemple :,\r\nRoyaume-Uni\r\nToute ville ou nation ne respectant pas cette syntaxe se verra contrainte de renommer (à vos frais) dans un délai à l'appréciation du staff.\r\n\r\nLes pseudos, surnoms, skins et titres Towny ne doivent pas être des publicités ni contenir de contenu explicite, sexuel ou autrement inapproprié.\r\n\r\n2.2 Vols et pillages\r\nLe pillage et le vol auprès d’autres joueurs sont autorisés. Il revient à chaque joueur de protéger ses biens.\r\n\r\n2.3 Spam\r\nIl est interdit de spammer ou d’envoyer des messages perturbant la fluidité du chat peu importe le motif (par ex., en envoyant le même message plusieurs fois).\r\n\r\n2.4 Comportement indésirable\r\nTout comportement suivant est interdit : \r\nHarcèlement explicite,\r\n\r\nCommentaires incitant à l’automutilation ou à la violence, y compris les discours haineux,\r\n\r\nDiscussions explicites ou avances à caractère sexuel,\r\n\r\nAccusations infondées ou nuisibles sur la réputation d’un joueur dans la vraie vie,\r\n\r\nToute tentative de manipulation, d’abus ou de relations inappropriées, surtout envers des mineurs. Ceci inclut demander des informations personnelles, messages inappropriés, flirt, etc.\r\n\r\nLa toxicité est évaluée au cas par cas par le staff, qui a le dernier mot. Les comportements répétés peuvent entraîner des mutes, avertissements ou bannissements.\r\n\r\n2.5 Usurpation d'identité\r\nUsurper l’identité d’autres joueurs ou de villes/nations (via pseudo, surnom, noms, etc.) est interdit. Les contrevenants devront corriger leur nom. En cas de préjudice, le staff pourra appliquer un bannissement.\r\n\r\n2.7 Partage d'informations personnelles\r\nIl est strictement interdit de partager les informations personnelles d’autrui sans leur autorisation explicite : Noms, photos, numéros, adresses, réseaux sociaux, IP, etc.\r\n\r\nIl est également interdit de menacer ou manipuler quelqu’un avec ses informations personnelles.\r\n\r\n2.8 Partage de liens\r\nLes liens malveillants (virus, enregistreurs d’IP, etc.) sont interdits. Tout lien permettant de contourner les règles listées ici est aussi interdit, même via Discord.\r\n\r\nLes liens à contenu sexuel ou extrêmement violent/dérangeant sont interdits. D’autres types de liens sont autorisés, mais peuvent être filtrés.\r\n\r\n2.9 Publicité\r\nLa publicité est interdite sauf si elle est liée au serveur.\r\n\r\n2.10 Vente de contenu ou services contre de l’argent réel\r\nIl est interdit de vendre des objets ou services en jeu contre de l’argent réel, ou inversement.\r\n\r\n2.11 Plainte concernant des actions n'enfreignant pas le règlement\r\nSe plaindre d'actions ou de comportements de joueurs respectant le règlement de façon trop insistante pourra être considéré comme du spam.	0
12	Grief	3.1 Destruction de terrain dans ou autour des claims\r\nDétruire des terrains dans ou autour des claims (grief de proximité) est interdit. Le staff restaurera les dégâts et avertira le joueur. Une récidive peut mener à un bannissement.\r\n\r\nExemples de grief (non exhaustif) :\r\n\r\nCobble monsters (énormes structures en cobble avec lave/eau),\r\n\r\nRideaux de lave/eau,\r\n\r\nGénération massive d’entités (poules, bateaux, etc.),\r\n\r\n3.2 Destruction de terrain dans la nature\r\nLa nature est définie comme les zones non revendiquées par Towny, c'est à dire hors des villes. Une demande de restauration peut être faite en cas de grief majeur.\r\n\r\n3.3 Claims de ville\r\nLes villes ne doivent pas :\r\n\r\nBloquer l’expansion de villes voisines (claim blocking),\r\n\r\nCréer des bras de claims pour bloquer ou étendre artificiellement leur territoire,\r\n\r\nAvoir des chunks non claims à l’intérieur de leurs limites,\r\n\r\nÊtre créées uniquement pour bloquer une autre ville,\r\n\r\n3.4 Vol \r\nLe vol de ressources, peu importe leur nature, est autorisé (ex., trahison, permissions mal gérées dans les villes...). C'est à vous de faire attention à vos transactions et permissions de villes/nation. Protégez vos ressources. En cas de difficultés avec l'utilisation de Towny, référez-vous au wiki dans ⁠╭-🪢liens-utiles du discord.\r\n\r\n3.5 Terraforming majeur\r\nPour préserver la géographie réelle, le terraforming majeur est interdit. Si cela modifie la carte du site, cela sera supprimé. Par exemple : vider des lacs, créer des îles artificielles, recouvrir l’océan.\r\n\r\n3.6 Art sur carte (Map art)\r\nLe map art est autorisé s’il ne gêne pas les autres villes ni ne cause de terraforming majeur. Il est recommandé de le faire en Antarctique. En dehors, vous devez claim la zone pour éviter les griefs de proximité.\r\n\r\nVotre map art ne doit pas contenir de nudité, contenu sexuel, images racistes ou autre élément enfreignant les règles de la section 2.	0
\.


